import React from "react";
import { useLocation } from "react-router-dom";

function Testsolver(){
    const location = useLocation();
    const test = location.state;
    
    return (
      <div>
        <h2>{test.TESTNAME}</h2>
        <p>Class: {test.CLASS}</p>
        {/* Display the questions */}
      </div>
    );

}
export default Testsolver
